import React from 'react';
import UseDataFetch from './FetchMensa';

const Mensaliste = () => {
    const data = UseDataFetch('/mensen');
    var options = [];
    const postTitle = () => {
        if (data) {
            for (var i in data) {
                var name2 = JSON.stringify(data[i].name);
                options.push(<option value={name2}>{name2}</option>);
            }
            return options;
        } else {
            return <h2>Daten werden geladen...</h2>;
        }
    };

    return (
        <div>
            <h1>Fetch-Hook</h1>
            <div>{postTitle()}</div>
        </div>
    );
}

export default Mensaliste;
